import React from "react";

export default class FilterButton extends React.Component {
    constructor(props) {
      super(props);
      this.state = {
        current : this.props.current,
        data: this.props.data
      };
    }

  render() {
      let data = this.state.data
      let bar = (<div></div>)
      let stats = (<div></div>)
    if (this.state.current){
        bar = (<div className = "current-project-bar">IN PROGRESS</div>)
    }else{
        bar = (<div className = "past-project-bar">Read More</div>)
        stats = (
            <div className = "project-stats">
                {data.stats.map((stat, index) => {
                    if (stat!= null){
                        return (
                            <div className = "project-stat">
                                <div className = "project-stat-number">{stat[0]}</div>
                                <div className = "project-stat-category">{stat[1]}</div>
                            </div>)}})}

                <div className = "project-stat">
                </div>
                <div className = "project-stat">
                </div>
            </div>
        )
    }
    return (
        <div className = "project-container">
            <div className = "project-photo-container">
            </div>
            <div className = "project-title">
            </div>
            <div className = "project-teams">
            </div>
            <div className = "project-description">
            </div>
            <div className = "project-label">
            </div>
            {stats}
            {bar}
        </div>
    )
}
}
